import React from 'react';

import {
  BrowserRouter as Router,
  Routes,
  Route,

} from 'react-router-dom';

import PagesPromotionsSearch from './Promotion/Search/Search';

const Root = () => {
  <Router>
    <Routes>
      <Route path="/" element={<PagesPromotionsSearch />} />
    </Routes>
  </Router>
}

export default Root;
